function Navbar() {
  return (
    <nav className="Navbar flex text-3xl mt-6 justify-between border-b-2 pb-16">
      <div className="logo uppercase font-bold text-green-500 border px-2 cursor-pointer hover:bg-green-500 hover:text-black">Resual</div>
      <div className="links flex gap-4">
        <a className="badge transition-all  text-3xl h-full pb-1 hover:bg-green-500 hover:text-black px-5" href="#">
          Home
        </a>
        <a className="badge transition-all  text-3xl h-full pb-1 hover:bg-green-500 hover:text-black px-5" href="#">
          new respae
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
